import React from 'react';
import styled from 'styled-components';
import logo from './logo.png'; // Ensure logo.png is located here

const Nav = styled.nav`
  display: flex;
  align-items: center;
  padding: 1rem;
  background-color: #004b23;
`;

const Logo = styled.img`
  height: 40px;
  margin-right: 1rem;
`;

const Title = styled.h1`
  font-size: 1.5rem;
  margin: 0;
  color: white;
`;

function Navbar() {
  return (
    <Nav>
      <Logo src={logo} alt="Centro Bus Predictor Logo" />
      <Title>Centro Bus Predictor</Title>
    </Nav>
  );
}

export default Navbar;
